-// canReuse reports whether the type t on the RHS of the declaration for base
+// canReuse reports whether the type rhs on the RHS of the declaration for def
 // may be re-used.
 //
-// Specifically, if base is non-nil and t is an interface type with methods, it
+// Specifically, if def is non-nil and rhs is an interface type with methods, it
 // may not be re-used because we have a convention of setting the receiver type
-// for interface methods to base.
-func canReuse(base *types.Named, t types.Type) bool {
-	if base == nil {
+// for interface methods to def.
+func canReuse(def *types.Named, rhs types.Type) bool {
+	if def == nil {
 		return true
 	}
-	iface, ok := t.(*types.Interface)
-	if !ok {
+	iface, _ := rhs.(*types.Interface)
+	if iface == nil {
 		return true
 	}
 	// Don't use iface.Empty() here as iface may not be complete.
